    function colorize(evt) {
      var zible = evt.target
      var mystere = Math.round(Math.random()*3)
      if (mystere == 1)
         zible.setAttribute("fill", "#de0000");
      else if (mystere == 2)
         zible.setAttribute("fill", "#de0000");
      else
         zible.setAttribute("fill", "#de0000");
      if (mystere == 1)
         zible.setAttribute("concentration", 50);
      else if (mystere == 2)
         zible.setAttribute("concentration", 50);
      else
         zible.setAttribute("concentration", 50);
  }
    function souriscolorize(evt) {
      var zible = evt.target
      var mystere = Math.round(Math.random()*3)
      if (souris == false)
         if (mystere == 1)
            zible.setAttribute("concentration", 50);
         else if (mystere == 2)
            zible.setAttribute("concentration", 50);
         else
            zible.setAttribute("concentration", 50);
      else
         null;
      if (souris == false)
         if (mystere == 1)
            zible.setAttribute("fill", "#de0000");
         else if (mystere == 2)
            zible.setAttribute("fill", "#de0000");
         else
            zible.setAttribute("fill", "#de0000");
      else
         null;
  }
